Uma das pouquíssimas vezes que tomei ceva desse estilo, mas curti muito. Essa garrafa veio na caixa da @cervejabox.
No copo apresenta espuma com ótima formação e retenção, na cor creme, com algumas bolhas grandes.
Aroma delicioso de chocolate amargo, um pouco de café e nozes e algo de casca de pão torrado. Eu ficaria sentindo esse aroma o dia todo.
O sabor segue o aroma, com esse chocolate bem presente, amargor médio e bem equilibrado. Cerveja bem sequinha e fácil de tomar.
Essa é daquelas cervejas escuras que não são nem um pouco difíceis de passar o dia tomando.
Alerto se tiver algum erro de digitação, pupilas estão dilatadas, não dá pra revisar o texto.
